nda conversación, Jette y yo comenzamos a fluir, entre risas, juegos y muchos movimientos exploratorios; generando una danza no solo en sus movimientos, sino en la mezcla de estos, con los míos apuntando la cámara hacia ella y jugando con dobles exposiciones, cristales y demás elementos compositivos. '=>'In this particular session, after a nice conversation, Jette and I began to flow, between laughter, games and many exploratory movements; generating a dance not only in her movements, but in the mixture of these, with mine pointing the camera at her and playing with double exposures, crystals and other compositional elements. ','Gracias Jette, por permitirte ser, y jugar como una niña explorando no solo el espacio, sino también tu expresión corporal y emocional.'=>'Thank you Jette, for allowing yourself to be, and to play like a child, exploring not only space, but also your bodily and emotional expression.','Me gusta empezar mis sesiones con retrato, retratos con ropa, aunque la sesión esté destinada a ser de desnudo. Porque siento que comenzar de esta forma me da mucha información acerca de la persona que tengo enfrente (cómo son sus gestos, su personalidad y cómo se está sintiendo en el momento). Esto me permite ya a partir de allí, dirigir la sesión hacia espacios adaptados a cada individuo, lo que consigue que los resultados sean verdaderamente personalizados. '=>'I like to start my sessions with a portrait, a clothed portrait, even if the session is intended to be nude. Because I feel that starting this way gives me a lot of information about the person in front of me (what their gestures are like, their personality and how they are feeling at the moment). This allows me to then direct the session towards spaces adapted to each individual, which makes the results truly personalized.   ','Modelo: @jett.ekowska'=>'Model: @jett.ekowska','No se trata de un copiar y pegar de poses estéticamente "atractivas" con cada persona que posa para ti; para mí las sesiones de fotos (aunque no todos vengan con esa intención), son sumamente terapéuticas, y son un compartir de energía brutal, por ello trato de integrarme y profundizar en cada persona, con el fin de conseguir que exprese su vulnerabilidad para mi cámara. '=>'It\'s not about copying and pasting aesthetically "attractive" poses with each person who poses for you; for me, photo sessions (although not everyone comes with that intention) are extremely therapeutic, and they are a brutal sharing of energy, so I try to integrate and delve into each person, in order to get them to express their vulnerability for my camera. ','Sesión de fotos con modelo de desnudo en estudio'=>'Sesión de fotos con modelo de desnudo en estudio','Sesión de fotos de desnudo en estudio'=>'Nude photo shoot in studio','a1a26de77a927b00f95b3c1e8fb30018'=>'https://marianaerato.local/wp-content/uploads/2024/04/DSC01479-2-scaled.jpg','a978a34c9016ad7d061c5fd5bab80d97'=>'https://marianaerato.local/wp-content/uploads/2024/04/DSC01565-scaled.jpg','ad3608dd31faa18d3d37f577ec69dd85'=>'https://marianaerato.local/wp-content/uploads/2024/04/DSC01461-scaled.jpg','b2c292f5018d03971ea2d8ea0ad6ee36'=>'In this particular session, after a nice conversation, Jette and I began to flow, between laughter, games and many exploratory movements; generating a dance not only in her movements, but in the mixture of these, with mine pointing the camera at her and playing with double exposures, crystals and other compositional elements. ','b44cc4c17478762a84fda9b317c7be2e'=>'https://marianaerato.local/wp-content/uploads/2024/04/DSF3760-scaled.jpg','b45a5c63f0af8b0f75bdbfd3ee647b32'=>'https://marianaerato.local/wp-content/uploads/2024/04/DSC01716-scaled.jpg','b8f1486466e7d43172003a4cdbc79b00'=>'https://marianaerato.local/wp-content/uploads/2024/04/DSC01603-scaled.jpg','b957747e765ddaa6edfb283eee54cbfb'=>'https://marianaerato.local/wp-content/uploads/2024/04/DSC01484-Edit-scaled.jpg','be28d85373d0e35b80ef5e0fabfa7e53'=>'https://marianaer